def meta_features(machine, field_prefix):
    res = []
    _map = {
        '{}_app_name'.format(field_prefix): app_names,
        '{}_app_version'.format(field_prefix): app_versions,
        '{}_auth_agent_type'.format(field_prefix): agent_types,
        '{}_brand_id'.format(field_prefix): brand_ids,
        '{}_os_version'.format(field_prefix): os_versions,
        '{}_os_name'.format(field_prefix): operating_systems,
        '{}_sys_info'.format(field_prefix): sys_infos,
        '{}_version'.format(field_prefix): versions,
        '{}_vm_name'.format(field_prefix): vm_names,
        '{}_vm_version'.format(field_prefix): vm_versions,
    }
    res += map_of_enumerated_fields(machine=machine, _map=_map)

    res += [
        Feature(as_obj={
            '_id': '{}_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_support'.format(field_prefix),
                               t='int'),
            'description': 'is {} supported?'.format(field_prefix)
        }),
        Feature(as_obj={
            '_id': '{}_ID'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_id'.format(field_prefix),
                               t='int'),
            'description': 'ID of {}?'.format(field_prefix)
        })
    ]
    return res


def extract(machine, args):
    res = []
    protocol = 'fox'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_device_id'.format(port, protocol)
        res += meta_features(machine, field_prefix)
    return res


